import React from 'react';

var dateFormat = require("dateformat");

const Tweet = ({tweets}) => (
    <>
            {tweets.map((thistweet, key) => 
                <table>
                    <th>
                        <div key={key} className="tweet-style1">
                            <img src={thistweet.user.profile_image_url} alt="not found" className="tweet-img"/>
                            <span className="tweet-style3 paddingleft marginbttm">{thistweet.user.screen_name}</span>
                            <span className="tweet-style2 paddingleft marginbttm">@{thistweet.user.name}</span>
                            <span className="tweet-style2 paddingleft marginbttm">{dateFormat(thistweet.created_at, "m/d/yy h:MM TT")}</span>
                            <p className="tweet-style4">{thistweet.text}</p>    
                        </div>  
                    </th>
                </table>
                 
            )}
    </>
)

export default Tweet;
